import { Button, TableBody, TableCell, TableRow, Table, TableHead, styled, StyledTextField } from '@mui/material';

import { categories } from '../../constants/data';

const StyledTable = styled(Table)`
    border: 10px solid rgba(224, 224, 224, 1);
`;

const StyledButton = styled(Button)`
    margin: 20px;
    width: 85%;
    background: #6495ED;
    color: #fff;
`;

const CenteredTableCell = styled(TableCell)`
    text-align: center;
`;


const Categories = () => {
    return (
        <>
            <StyledTable>
                <TableHead>
                    <TableRow>
                        <CenteredTableCell>
                            Filter
                        </CenteredTableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {categories.map(category => (
                        <TableRow key={category.id}>
                            <TableCell>
                                <StyledTextField />
                            </TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </StyledTable>
            <StyledButton>create</StyledButton>
        </>
    );
};

export default Categories;
